import React from 'react';

export default function Form() {
  return (
    <div className="App">
      <form>
        <input type='text' className='data' />
        <br />
        <img src="../logDOM.svg" className='qrcode' />
        <button className='btn'>Generate QR Code</button>
      </form>
    </div>
  );
}
